import React from "react";
import Navigation from "../../components/Navigation";

const TemplatePage = (props) => {
    return(
        <>
        <Navigation />
    
            <div className=' border h-screen mx-3'>
                <p className="border w-full flex justify-center mt-28 text-white text-2xl">{props.sectionName}</p>
                <div className="border mt-5 space-x-5 mx-5 flex justify-center">
                    <div className="border p-1 rounded-md w-8">
                    <button>Code</button>
                    </div>
                </div>
            </div>
        </>
    );
}

export default TemplatePage;
